    <React.StrictMode >
        <BrowserRouter>
            <Suspense
                fallback = {loadingMarkup} >
                < App/>
            </Suspense >
        </BrowserRouter>


    </React.StrictMode>,
    document.getElementById('root')
);

reportWebVitals();
